-module(letsGo).
-author("SonniiBoi").
-import(skel,[do/2]).
-import(lists,[droplast/1,append/2,sum/1,nth/2,reverse/2,sublist/2,sublist/3,delete/2,nthtail/2]).
%% API
-export([doARow/2,add/3,getSecond/3,catchNumbers/3,startMultiplication4x4/0,splitBack/5, startMultiplication10x10/0, startMultiplication50x50/0, startMultiplication100x100/0]).

% multiplies two rows together
doARow([],[]) ->
  [];
doARow([First|Rest], [First2|Rest2])->
  [First * First2 | doARow(Rest,Rest2)].

% sums the result from the multiplication
add(List,List2, I) ->
  FirstElement = doARow(List,List2),
  catchNumbers ! {I,sum(FirstElement)}.

% gets the column of the second matrix for the current multiplication
getSecond(Matrix2,0,I) ->
  [];
getSecond(Matrix2,LengthOfMatrix2,I) ->
  [nth(I,nth(LengthOfMatrix2,Matrix2))| getSecond(Matrix2,LengthOfMatrix2-1,I)].

% calls the add function (i.e starts matrix multiplication)
% distributes each multiplication onto a separate process
run(Matrix,Matrix2,I,0,N,Numbers)->
  done;
run(Matrix,Matrix2, I, Last,N,Numbers) ->
  spawn(letsGo,add,[nth(((I-1) div N) + 1 , Matrix), reverse(getSecond(Matrix2,length(Matrix2), ((I-1) rem N) +1 ), []), I]),
  run(Matrix,Matrix2,I+1,Last-1,N,Numbers).


%%% catches numbers returned from add in array
%%% than covnerts array into list and sends it to matrixMultiplication
catchNumbers(Numbers, 0,Pid) ->
  Pid ! {array:to_list(Numbers)};
catchNumbers(Numbers,N,Pid) ->
  receive
    {Index,Number} ->
      catchNumbers(array:set(Index-1,Number,Numbers),N-1,Pid)
  end.

% makes 1d list returned from multiplication into 2d list
splitBack(Answer,LengthOfSplits,LengthOfOriginal,1,J) ->
  [sublist(Answer,J,LengthOfSplits)];
splitBack(Answer,LengthOfSplits,LengthOfOriginal,I,J) ->
  [sublist(Answer,J,LengthOfSplits) | splitBack(Answer,LengthOfSplits, LengthOfOriginal,I-1,J+LengthOfSplits)].

% sets up the matrices than calls run which starts the matrix multiplication

startMultiplication4x4()->
  Matrix1 = [[1,2,3,4],
   [4,5,6,7],
   [7,8,9,8],
   [19,2,4,5]],
  Matrix2 = [[1,2,3,4],
   [4,5,6,7],
   [7,8,9,10],
   [3,4,5,6]],

  % starts the clocks, runtime is cpu runtime
  % wall_clock is actual time
  statistics(runtime),
  statistics(wall_clock),

  Numbers = array:new(length(Matrix2) * length(nth(1,Matrix2))) ,

  % makes catchNumbers able to be sent to by catchNumbers rather than its thread id
  % it also launches a processor that's running  catchNumbers
  % catchNumbers catches the values of the solution as the adds finish
  register(catchNumbers, spawn(letsGo,catchNumbers,[Numbers, length(Matrix2) * length(nth(1,Matrix2)),self()])),

  % distributes processes
  run(Matrix1,Matrix2,1,length(Matrix2) * length(nth(1,Matrix2)),length(Matrix2),Numbers),

  % receives the final solution from catchNumbers
  receive
  {Solution} ->
    io:format("~w~n", [splitBack(Solution,length(nth(1,Matrix2)),length(Solution),length(Matrix2),1)])
  end,

  % tuples storing the times
  {_, Time1} = statistics(runtime),
  {_, Time2} = statistics(wall_clock),

  % microsecond conversion
  T1 = Time1 * 1000,
  T2 = Time2 * 1000,
  io:format("Runtime = ~p microseconds ~nRealtime = ~p microseconds~n", [T1, T2]).


